import React from 'react';
import { FaRegLightbulb } from "react-icons/fa";
import "../styles/PreviewCard.css"

function PreviewCard(props){

    return(
        <div class="container">
            <div class="preview-card">
                <h3>{props.title}</h3>
                <p>{props.text}</p>
                <div class="about-button">
                    <FaRegLightbulb/>
                    <h4>Know more...</h4>
                </div>
            </div>
        </div>
    )
}

export default PreviewCard;
